When my husband and a good friend had all their teeth pulled at one time, I began to convert some of my favorite recipes to accommodate their toothless state.

Most are cooked slowly in a six-quart Crock-Pot for four to six hours. The surprise was, they still enjoy these, and I prepare these for company as well.

They all request these recipes, so here goes. I'll start with the most requested entree recipes I make. This one is a never-fail, great dinner for company that is simple, rich, hearty, and comforting-Rhea's chicken and noodles
